import React from "react";
import ReactDOM from 'react-dom';
import add, { sub, mult, divide } from "./App";

ReactDOM.render(
<>
<Add />
<ul>

<li>the addition is {add(30,24)} </li>
<li> the substraction is {sub(9,4)}</li>
<li>the multiplication is {mult(21,20) }</li>
<li>the devide is {divide(15,3)}</li>

</ul>
</>,
document.getElementById("root")
);
